import React from "react";

function FilterYear(props) {
  return (
    <div
      style={{
        display: "flex",
        width: "93%",
        height: 50,
        fontSize: 20,
        margin: 20,
        justifyContent: "space-between",
        alignItems: "center",
      }}
    >
      <b
        style={{
          color: "white",
        }}
      >
        Filter by year
      </b>
      <select
        style={{
          color: "black",
          width: 190,
          borderRadius: 5,
          right: 0,
          height: 50,
          fontSize: 20,
          fontWeight: "bold",
          textAlign: "center",
        }}
      >
        {props.details.map((detail, index) => {
        //   const year = [...new Set(detail.date.slice(0, 4))]

          return <option key={index} >
                {detail.date.slice(0,)}
          </option>
        })}
      </select>
    </div>
  );
}

export default FilterYear;
